import React from "react";

export default function Navbar() {
  return (
    <nav className="navbar sticky-top" style={{backgroundColor: 'rgb(247, 242, 242)'}}>
        <span className="navbar-brand mb-0 h1" style={{color: "#028B2E", fontSize: "200%"}}>
            BELKA  <br/>
            <h6 style={{color: '#028B2E'}}>Empowering Our Community</h6>
        </span>
    </nav>
  );
}
